# BINARY
                        

                        
        
def charToBin(data):
    try:
        return bin(ord(data))[2:]
    except TypeError:
        return data
def strToBin(data):
    if(len(data) != 1):
        str_data = str()
        for i in data:
            str_data+= bin(ord(i))[2:]+" "
        str_data = str_data[:-1]
        return str_data
    elif(len(data) > 1):
        return charToBin(data)
def binToChar(data):
    return chr(int(data,2))
def binToStr(data):
    if(len(data)!= 1):
        str_data = str()
        for i in data.split(" "):
            str_data+= chr(int(i,2))
        return str_data
    else:
        return binToChar(data)
