# OCTAL
#
def charToOct(data):
    return oct(ord(data))
def strToOct(data):
    if(len(data) != 1):
        str_data = str()
        for i in data:
            str_data+= oct(ord(i))+" "
        str_data = str_data[:-1]
        return str_data
    elif(len(data) > 1):
        return charToOct(data)
def octToChar(data):
    return chr(int(data,8))
def octToStr(data):
    if(len(data)!= 1):
        str_data = str()
        for i in data.split(" "):
            str_data+= chr(int(i,8))
        return str_data
    else:
        return octToChar(data)
