# DECIMAL
#
def charToDec(data):
    return ord(data)
def strToDec(data):
    if(len(data) != 1):
        str_data = str()
        for i in data:
            str_data+= str(ord(i))+" "
        str_data = str_data[:-1]
        return str_data
    elif(len(data) > 1):
        return charToDec(data)
def decToChar(data):
    return chr(int(data,10))
def decToStr(data):
    if(len(data)!= 1):
        str_data = str()
        for i in data.split(" "):
            str_data+= chr(int(i,10))
        return str_data
    else:
        return decToChar(data)
#
# HEXDECIMAL
#
def charToHex(data):
    return ord(data)
def strToHex(data):
    if(len(data) != 1):
        str_data = str()
        for i in data:
            str_data+= hex(ord(i))[2:]+" "
        str_data = str_data[:-1]
        return str_data
    elif(len(data) > 1):
        return charToDec(data)
def hexToChar(data):
    return chr(int(data,16))
def hexToStr(data):
    if(len(data)!= 1):
        str_data = str()
        for i in data.split(" "):
            str_data+= chr(int(i,16))
        return str_data
    else:
        return decToChar(data)
